  false,\n\t\"url\": null,\n\t\"notes\": \"The Wildlife Management Study - Project
  No. 2 dated May 15, 1969 was developed to evaluate the production of moist soil
  food plants in the Mississippi River flood plain and their subsequent use by waterfowl.
  To aid in the evaluation of this project, annual vegetation line transects were
  set up and conducted at Clarence Cannon National Wildlife Refuge. This report summarizes
  the 1971 results.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
